snippet.description:
Bringing together some of the top names in music and entertainment, both Intuit Dome and the Kia Forum will host FireAid on Thursday, January 30, to raise money for rebuilding communities devastated by wildfires and supporting efforts to prevent future fire disasters throughout Southern California. Donate now at https://fireaidla.org/ or via the 'Donate' button on YouTube.

Performing artists include:
@Alanis, @AndersonPaak, @BillieEilish, @DaveMatthewsBand & @johnmayer, @Dawesmusic, @GracieAbrams, @OfficialGrahamNash, @GreenDay, @JellyRoll, @JohnFogerty, @JoniMitchell, @KatyPerry, @LadyGaga, @LilBabyATL, @NoDoubt, @OliviaRodrigo, @pesopluma_oficial, @PinkVideoVault, @RedHotChiliPeppers, @rodstewart, @StephenStillsOfficial, @StevieNicks, @steviewonder, @theofficialsting, @TateMcRae, @Croweology

